import React from 'react';
import { Container, Grid } from 'semantic-ui-react';
import layout from './layout';


const receiptGenerator = () => {

    return (
        <Container>
            <Grid divided='verically' verticalAlign='middle'>
                <Grid.Column width={8}>
                    This a component
                </Grid.Column>
                <Grid.Column right width={8}>
                    This a component
                </Grid.Column>
            </Grid>
        </Container>
    );
}

export default receiptGenerator;
